model POD_Divider

equation
	yo1 = Selfix(Mode, 0, yi);
	yo2 = Selfix(Mode, yi, 0);

end POD_Divider;

function Selfix
	input Boolean boolexpr;
	input Real x;
	input Real y;
	output Real outputexpr;
	parameter Real initializedVariable;
algorithm
	initializedVariable = conditionalInitialization(boolexpr);
	if initializedVariable then
		outputexpr = x;
	else
		outputexpr = y;
	end if;
end Selfix;

model POD_Selector_5

equation
	yo = Selfix((Input>4.5), yi5, Selfix(Input>3.5,yi4,Selfix((Input>2.5),yi3,Selfix((Input>1.5),yi2,Selfix((Input>0.5),yi1,0.0)))));

end POD_Selector_5;

