model POD_Washout_filter

equation
	dx=Select((Tw>0),((yi-x)/Tw),0);
	der(x)=dx;
	yo=Select((Tw>0),(Tw*dx),yi);


end POD_Washout_filter;

function Select
	input Boolean boolexpr;
	input Real x;
	input Real y;
	output Real varA;
algorithm
	if boolexpr then
		varA = x;
	else
		varA = y;
	end if;
end Select;

