model POD_Gain_K

equation
	yo=K*yi;

end POD_Gain_K;

model POD_Limiter_with_constant_limits

equation
	yo = LimConst(yi, ymin, ymax);

end POD_Limiter_with_constant_limits;

function LimConst
	input Real x;
	input Real minLim;
	input Real maxLim;
	output Real yo;
algorithm
	if x < minLim then
		yo = minLim;
	else if x > maxLim then
		yo = maxLim;
	else
		yo = x;
	end if;
end LimConst;

