model POD_Lead-lag_2

equation
	der(x)=Select((T1>0),((yo-x)/T1),(Select((T2>0),((yi-yo)/T2),0)));
	yoint=Select((T1>0 and T2>0),((T1/T2-1)*(yi*Kint-x)),(Select(T2>0,(LimState(x,MIN,MAX)),yi)));
	yo=lim(Select((T1-T2<>0 and T2<>0),yoint,yi),MIN,MAX);

end POD_Lead-lag_2;

function Select
	input Boolean boolexpr;
	input Real x;
	input Real y;
	output Real varA;
algorithm
	if boolexpr then
		varA = x;
	else
		varA = y;
	end if;
end Select;

function LimState
	input Real x1 (stateSelect=StateSelect.always);
	input Real xmin;
	input Real xmax;
	output Real yo;
algorithm
	domainType = 1; // 1 for RMS, 0 for EMT simulation
	if x < xmin then
		yo = xmin;
	else if x > xmax then
		yo = xmax;
	else
		yo = x1;
	end if;
end LimState;

model POD_Derivative_with_gain

equation
	dx=Kd*(yi-x);
	der(x)=dx;
	yo=dx;

end POD_Derivative_with_gain;

model POD_Invert_Signal

equation
	yo = -yi;

end POD_Invert_Signal;

model POD_Lead-lag_1

